import React from 'react'
import useFech from './useFetch';

const App = () => {
  const { fetchData, data } = useFech()

  React.useEffect(() => {
    fetchData('https://ranekapi.origamid.dev/json/api/produto/')
  }, [])

  console.log(data)

  return(
    <>
    {data }
    </>
  ) 
};



export default App
